      "description": "<p>PRODUCTOS IMPORTADOS TRAÍDOS DESDE ESTADOS UNIDOS, VIENEN SELLADOS CON GARANTÍA OFICIAL POR 12 MESES.</p><br><p>CONSULTAR STOCK ANTES DE COMPRAR.</p><br><p>PRECIO PUBLICADO SIN IVA, SE PUEDE HACER FACTURA A (CONSULTAR).</p><br><p>PUNTO DE RETIRO EN RECOLETA.</p><br><p>CUALQUIER DUDA, CONSULTANOS! ESTAMOS PARA AYUDARTE A ENCONTRAR TU NUEVO BFF.</p><br><p>Info:</p><br><p>El iPhone 12 mini incluye grandes funcionalidades en un diseño compacto de 5.4 pulgadas (1). Tiene una espectacular pantalla Super Retina XDR. Un frente de Ceramic Shield, cuatro veces más resistente a las caídas (2). Modo Noche en todas las cámaras, para que puedas tomar fotos increíbles con poca luz. Grabación, edición y reproducción de video HDR en Dolby Vision con calidad cinematográfica. Y el potente chip A14 Bionic. Además, es compatible con los nuevos accesorios MagSafe, que se acoplan fácilmente a tu iPhone y permiten una carga inalámbrica más rápida (3). Un verdadero gigante.</p><br><br><p>Avisos Legales</p><p>(1) La pantalla tiene las esquinas redondeadas. Si se mide en forma de rectángulo, la pantalla tiene 5.42 pulgadas en diagonal. El área real de visualización es menor.</p><p>(2) La afirmación se basa en la comparación de la parte frontal de Ceramic Shield del iPhone 12 mini con respecto a la generación anterior de iPhone.</p><p>(3) Los accesorios se venden por separado.</p><p>(4) El iPhone 12 mini es resistente a las salpicaduras, al agua y al polvo, y fue probado en condiciones de laboratorio controladas, con una clasificación IP68 según la norma IEC 60529 (hasta 30 minutos a una profundidad máxima de 6 metros). La resistencia a las salpicaduras, al agua y al polvo no es una condición permanente y podría disminuir como consecuencia del uso normal. No intentes cargar un iPhone mojado; consulta el manual del usuario para ver las instrucciones de limpieza y secado. La garantía no cubre daños producidos por líquidos.</p><br>",
